import Profile from './components/Profile';

const Example = () => {
  const profile = [{ name: 'Geo', age: 18, hobbies: ['sports', 'music'] }];
  return (
    <>
      <ul>
        <Profile {...profile[0]} />
      </ul>
    </>
  );
};

export default Example;
